import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Minus = createReactComponent("Minus", ["svg", defaultAttributes, [["line", {
  x1: "5",
  y1: "12",
  x2: "19",
  y2: "12",
  key: "iqslzh"
}]]]);
export default Minus;
